Controla o Ciclo de Vida dos CDRs Pendentes demonstrando o histórico da pendência nos Sistemas do Ciclo da Receita.
- Acompanhamento do volume de CDRs pendentes;
- Gestão histórica da reciclagem e alarmes de inconsistências de cada sistema resolvido;
- Validações para geração de alarmes:
         Decurso de Prazo por Sistema (parametrizável);
         Decurso de Prazo por por Tipo de Tráfego (parametrizável);
- Visão consolidada das 13 (treze) últimas referências de tráfego dos volumes de pendentes, excluídos e recuperados por sistema envolvido;
- Visão detalhada dos CDRs Pendentes nas 6 (seis) últimas referências de tráfego por sistema envolvido;
- Disponibilização ao usuário de Workflow para Tratamento de Casos de Alarmes, Relatórios e Indicadores (Gráficos, Consultas e Dashboards).

