Aplicação legada, em plataforma mainframe, desenvolvido em Natural/Adabas.
Principais processos de atendimento:
* Retificação de serviços e faturas;
* Devolução de valores (OPR´s);
* 2ª via de contas via correio;
* Informes de pagamentos;
* Parcelamento de débitos.

Sistema de indicadores de dados e ADSL de RII. Carrega dados D-1 de OS e BD. Calcula indicadores contratuais e Anatel. Formata dados para envio à Anatel com arquivos e planilhas enviadas por outros sistemas e usuários.
Módulos de Indicadores e de Pagamento, referente a Dados e ADSL, tem como objetivo:
- Pagamento de PSR;
- Montagem de plano de ação;
- Controle de execução de BD e apuração de indicadores  Anatel;
- Controle do resultado operacional;
- Download total de BD´s e total de acessos.

Os módulos SICI e STFC visam formatação de dados para envio à Anatel.

Apoio a projeto de Enlaces, gestão da planta de Enlace da Brasil Telecom e atendimento a Resoluções ANATEL.(O sistema de Rádio Enlace visa atender a área de Planejamento de Transporte e Acesso que possui a necessidade de visão de controle de sua planta de rádios digitais e analógicos ponto a ponto e ponto multiponto e de sistemas satélites. Que contêm os seguintes objetivos:
Facilitar a atividade de planejamento de enlaces provendo análise de desempenho e interferência dos enlaces cadastrados no sistema;
 - Integrar informações da planta de Rádio-Enlaces das diversas filiais;
 - Fornecer a visão da planta de Rádio-Enlaces através de seu cadastro;
 - Prover controle e acompanhamento dos estados dos enlaces da planta;
 - Prover consultas customizadas para auxilio à tomada de decisões;
 -Prover relatórios customizados automatizando parte do processo de solicitação de licenciamento na ANATEL;
 - Simular taxas da ANATEL para o planejamento de custos envolvidos em uma implantação e/ou mudança de enlaces da planta.
)

Sistema para atendimento de auxilio a lista telefônica R1 e R2;
Base de dados alimentada através de extrações diárias oriundas do STC (R1) e SAC (R2);
Solução desenvolvida pela própria Teclan com banco de dados em MySQL utilizando plataforma baixa.

Este sistema permite o gerenciamento dos servidores do DataCenter.
Disponibiliza os segintes recursos:
   - Interface web com SSL;
   - Virtual KVM (teclado, vídeo e mouse) com visualização da ultima tela antes da falha;
   - Acesso a mídias virtuais (montagem de mídias remotas);
   - Conexão ethernet UDP/TCP;
   - Controle de liga/desliga e reset remoto;
   - Autenticação via LDAP e local;
   - Atribuição de IP via DHCP e manual.
exemplos: HP iLO, IPMI 1.5, IPMI 2.0, Dell DRAC, IBM® RSA II, Sun® ALOM etc.

Recebe as reclamações relativa as faturas de um cliente, cadastra para apuração, permite apuração, gera créditos em casos de procedencias e débitos em caso de improcedência. Gera informações de erro em conta e taxa de créditos devolvidos no prazo para Anatel. Contestação é dividia em Pré- Contestação e Contestação:

1) MÓDULO PRE-CONTESTAÇÃO :
- módulo de entrada para contestações de contas exclusivo do varejo;
- evita que contestações improcedentes sejam transferidas para o módulo de contestação e consequentemente prejudiquem os indicadores de erro em conta;
2) MÓDULO CONTESTAÇÃO :
- Recebe todas as contestações : pré-contestação, varejo, FGC, customizada;
-  As pré-contestações já vêm apuradas e somente os itens procedentes;
- Os itens contestados entram nos indicadores de erro em conta independentemente da contestação ser ou não procedente;

Processa a negociação de dívidas entre a empresa e o cliente. Permite a cobrança do débito (atualizado) do cliente dividido em: entrada cobrada através de conta especial, parcelas cobradas em contas telefônicas futuras;
Permite o parcelamento do débito de vários terminais do cliente através de um único contrato;
Permite negociações individuais através de solicitação do cliente ou negociações em massa.
Permite o parcelamento econômico, ou seja, associação de produto de restrição de consumo  Fale Local, Minha Linha, CATCEL, BLODDC, etc  aos terminais parcelados.

Sistema de Gerência e Administração Velox, com visão operacional dos reparos, serviços e base de circuitos VELOX, com informações sobre:
 - Total de Instalações;
 - Total de o FCL2 (indica total de reparos efetuados em relação à planta);
 - Total de reparos repetidos;
 - Total de reparos em garantia;
Gestão de OS abertas/BD abertos.
